"    <div id=\"topicTitle\">",
"     Patient information: Patellofemoral pain syndrome (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/patellofemoral-pain-syndrome-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H278125868\">",
"      <span class=\"h1\">",
"       What is patellofemoral pain syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Patellofemoral pain syndrome is a condition that causes pain in the front of the knee. It involves the knee cap, which doctors call the &ldquo;patella&rdquo; (",
"      <a class=\"graphic graphic_figure graphicRef57878 \" href=\"UTD.htm?17/11/17584\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Many times, patellofemoral pain syndrome happens in runners or other people who put a lot of pressure on their knees. But the condition can also happen when a person&rsquo;s knee cap gets out of line with the knee joint.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H278125883\">",
"      <span class=\"h1\">",
"       What are the symptoms of patellofemoral pain syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Patellofemoral pain syndrome causes pain in the front of the knee, or around or behind the knee cap. The pain can come on slowly or quickly. The pain is usually worse when people squat, run, or sit for a long time. Some people might also feel as if their knee is giving out.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H278125898\">",
"      <span class=\"h1\">",
"       Is there a test for patellofemoral pain syndrome?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No test can tell for sure if you have patellofemoral pain syndrome. But your doctor or nurse should be able to tell if you have the condition by learning about your symptoms and doing an exam.",
"     </p>",
"     <p>",
"      To make sure your symptoms aren&rsquo;t caused by another condition, your doctor might order an X-ray or imaging test of your knee. Imaging tests create pictures of the inside of the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H278125913\">",
"      <span class=\"h1\">",
"       How is patellofemoral pain syndrome treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment usually involves a few parts.",
"     </p>",
"     <p>",
"      The first part of treatment helps to reduce your pain. It can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Resting your knee and avoiding activities or movements that make the pain worse",
"       </li>",
"       <li>",
"        Taking nonsteroidal anti-inflammatory drugs, also called &ldquo;NSAIDs&rdquo; &ndash; NSAIDs are a large group of medicines that includes",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil&reg;, Motrin&reg;) and",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sample brand names: Aleve&reg;, Naprosyn&reg;).",
"       </li>",
"       <li>",
"        Putting ice on your knee when it hurts or after activities that cause pain &ndash; You can put a cold gel pack, bag of ice, or bag of frozen vegetables on the painful area every 1 to 2 hours, for 15 minutes each time. Put a thin towel between the ice (or other cold object) and your skin.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Another part of treatment involves doing exercises to strengthen the muscles around your knee. Your doctor or nurse will show you which exercises to do, or he or she will have you work with a physical therapist (exercise expert).",
"     </p>",
"     <p>",
"      Your doctor might also recommend that you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Wear a knee brace to support your knee.",
"       </li>",
"       <li>",
"        Tape up your knee in a certain way to support your knee.",
"       </li>",
"       <li>",
"        Wear special shoe inserts made to fit your foot (to keep your foot from turning in or out too much).",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Your symptoms will most likely improve with treatment. But if they don&rsquo;t, your doctor might have you see a knee specialist to discuss treating your condition with surgery.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H278125928\">",
"      <span class=\"h1\">",
"       How can I prevent getting patellofemoral pain syndrome again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can reduce your chances of getting this condition again by doing the exercises and stretches that your doctor or physical therapist shows you.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H278125943\">",
"      <span class=\"h1\">",
"       More on this topic",
