var title_f18_10_18602="Ventricular escape tutorial";
var content_f18_10_18602=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F54024%7ECARD%2F51446&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F54024%7ECARD%2F51446&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1097px;\">",
"  <div class=\"figure\" style=\"width: 521px\">",
"   <div class=\"ttl\">",
"    Complete heart block: sinus rhythm with slow junctional or idioventricular escape rhythym",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 501px; height: 97px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Multiple successive QRS complexes appear that are of ventricular origin and occur at a rate which is slower than the underlying sinus rhythm. The presence of P waves that occur independent of the QRS complexes is evidence of atrioventricular dissociation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 456px\">",
"   <div class=\"ttl\">",
"    Sinus rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 103px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The normal P wave in sinus rhythm is slightly notched since activation of the right atrium precedes that of the left atrium. The P wave is upright in a positive direction in leads I and II. A P wave with a uniform morphology precedes each QRS complex. The rate is between 60 and 100 beats per minute and the cycle length is uniform between sequential P waves and QRS complexes. In addition, the P wave morphology and PR intervals are identical from beat to beat.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Third degree (complete) atrioventricular block with wide QRS escape rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 434px; height: 68px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The P waves are completely dissociated from the QRS complexes and the PR intervals are variable. The atrial or PP rate (75 beats per minute) is faster than the ventricular or RR rate (30 beats per minute), establishing complete atrioventricular nodal blockade as the etiology. The QRS complexes are wide indicating that the escape rhythm is ventricular.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
