var title_f18_10_18605="Predicting HIT";
var content_f18_10_18605=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F70437&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F70437&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 631px\">",
"   <div class=\"ttl\">",
"    Nomogram of logistic regression model for predicting HIT",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 611px; height: 207px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Results of the anti-heparin/platelet factor 4 ELISA test, stated in terms of the optical density of the result (PF4 OD) and results of a confirmatory functional assay (Confirm: Neg indicates negative; and Pos, positive) values are displayed on the outer scales. Connecting a pair of PF4 OD and confirmatory assay results using a straight edge allows one to estimate the probability of heparin-induced thrombocytopenia (HIT) from the center scale.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     This research was originally published in Blood. Whitlatch NL, Kong DF, Metjian AD, et al. Validation of the high-dose heparin confirmatory step for the diagnosis of heparin-induced thrombocytopenia. Blood 2010; 116:1761. Copyright &copy; 2010 American Society of Hematology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
