"    Dobutamine echocardiography predicts outcome in an ischemic cardiomyopathy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 471px; height: 294px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown is the event-free survival in 87 patients with an ischemic cardiomyopathy who underwent dobutamine echocardiography. Among patients with evidence of hibernating myocardium (&ge;5 of 12 segments showing viability) mortality was significantly lower among those undergoing revascularization (3 versus 31 percent for medical therapy, p = 0.01). In patients without evidence of hibernation (&lt;5 of 12 segments showing viability), there was no difference in mortality with revascularization or medical therapy (50 versus 44 percent).",
